n        // 第二套设计方案\n        color: rgba(0, 0, 0, 0.5);\n        font-size: 20px;\n        .ver {\n            margin-left: 5px;\n            font-size: 12px;\n        }\n    }\n}\n\n.task-fliter {\n    flex: none;\n    width: 100vw;\n    height: 100px;\n}\n\n// 第一套设计方案\n// .task-add-task {\n//     position: absolute;\n//     right: 0;\n//     top: -10px;\n//     width: 80px;\n//     line-height: 3;\n//     border-radius: 2px;\n//     font-weight: bold;\n//     transform: translate(0, -100%);\n//     @extend %green-button;\n//     box-shadow: 0 0 3px 0px rgba(6, 74, 169, 0.5);\n//     &:after {\n//         content: '添加任务';\n//     }\n// }\n// 第二套设计方案\n.task-table-ribbon {\n    display: flex;\n    position: absolute;\n    right: 0;\n    top: -10px;\n    transform: translate(0, -100%);\n    .ant-select {\n        // &:not(:last-child) {\n        margin-right: 10px; // }\n    }\n    .last-week-hide,\n    .this-week-hide {\n        display: none;\n    }\n}\n\n.task-table-filter-panel {\n    transform: scale(0);\n    transition: transform .3s ease;\n    &.active {\n        transform: scale(1);\n        transition: transform .3s ease;\n    }\n}\n\n.task-table-filter {\n    display: flex; // margin-right: 10px;\n}\n\n.task-table-filter-button {\n    margin-right: 10px; // color: $line-color;\n    color: #3fbbf5;\n    background-color: #fff;\n    border-color: #3fbbf5;\n}\n\n.table-main {\n    flex: 1 0 auto;\n    position: relative;\n    margin: 0 auto;\n    margin-top: 100px;\n    width: $width;\n    border-radius: 5px;\n    background: #FFF; // 第一套设计方案\n    // box-shadow: 0 0 5px 0px rgba(6, 74, 169, 0.5);\n    // 第二套设计方案\n    box-shadow: 0 0 0 0px rgba(6, 74, 169, 0.5);\n}\n\n%listItem {\n    position: relative;\n    flex: 0 0 100px;\n    list-style: none;\n    text-align: center;\n    line-height: $line-height;\n    &:first-child {\n        flex: 6 1 auto;\n        @extend %text-overflow;\n    }\n}\n\n%itemIcon {\n    position: absolute;\n    left: 6px;\n    top: 50%;\n    line-height: 2;\n    padding: 0 5px;\n    font-style: normal;\n    text-align: center;\n    border-radius: 2px;\n    color: #FFF;\n    transform: translate(0, -50%) scale(0.834);\n}\n\n.task-main-table-head {\n    display: flex;\n    width: $width;\n    border-bottom: 1px solid $border-color;\n    >li {\n        @extend %listItem;\n    }\n}\n\n.task-main-table-content {\n    margin-bottom: 40px;\n}\n\n.task-main-table-content-item {\n    &:not(:last-child) {\n        border-bottom: 1px solid $border-color;\n    }\n    .item-ul {\n        position: relative;\n        display: flex;\n        &:hover {\n            .item-event-mask {\n                opacity: 1;\n                transform: scale(1);\n                transition: all .4s cubic-bezier(.59, 0.58, 0.57, 1);\n            }\n        }\n    }\n    .item-event-mask {\n        display: flex;\n        position: absolute;\n        top: 0;\n        bottom: 0;\n        left: 0;\n        right: 0;\n        align-items: center;\n        justify-content: flex-end;\n        padding: 0 10px;\n        opacity: 0; // 第一套设计方案\n        // background: rgba(91, 150, 179, 0.5);\n        // 第二套设计方案\n        background: rgba(0, 0, 0, 0.3); // box-shadow: 0px -10px 20px 0px rgba(121, 121, 121, 0.25) inset;\n        transform: scale(.98);\n        transition: all 0.6s ease-out;\n    }\n    .item-event-button {\n        margin: 0 10px;\n        padding: 0 10px;\n        line-height: 2;\n        color: $light;\n        border-radius: 2px;\n        cursor: pointer;\n        &.delete-button {\n            background: #ff4351;\n        }\n        &.change-button {\n            background: #ffc107;\n        }\n        &.view-button {\n            background: #1fc759;\n        }\n    }\n    .item-li {\n        @extend %listItem;\n        transition: background .3s;\n        &:first-child {\n            text-align: left;\n            padding-left: 70px;\n            letter-spacing: .05em;\n            &:before {\n                content: '开发任务';\n                @extend %itemIcon;\n                background: $green;\n                letter-spacing: 0;\n            }\n        } // &:hover {\n        //     background: $border-color;\n        //     transition: background .3s;\n        // }\n        &.item-li-time {\n            letter-spacing: 0.07em;\n        }\n        .task-state {\n            padding: 2px;\n            border-radius: 2px;\n            border-width: 1px;\n            border-style: solid;\n        }\n        .tsak-state-not-started {\n            color: $bug-color;\n            border-color: $bug-color;\n        }\n        .tsak-state-ongoing {\n            color: $orange;\n            border-color: $orange;\n        }\n        .tsak-state-done {\n            color: $green;\n            border-color: $green;\n        }\n    }\n    .item-li-not {\n        position: relative;\n        flex: 1;\n        list-style: none;\n        text-align: center;\n        color: #c7c7c7;\n        line-height: $line-height;\n        letter-spacing: 0.05em;\n        .anticon-exclamation-circle-o {\n            margin-right: 5px;\n        }\n    }\n    .item-bug {\n        >.item-ul {\n            background: #f3faff;\n        }\n        li {\n            &:first-child {\n                position: relative;\n                text-align: left;\n                padding-left: 70px;\n                &:before {\n                    content: '修复缺陷';\n                    @extend %itemIcon;\n                    background: $bug-color;\n                }\n            }\n            border-bottom:1px solid $light;\n        }\n    }\n    &.type-bug {\n        .item-li {\n            &:first-child {\n                &:before {\n                    content: '修复缺陷';\n                    background: $bug-color;\n                }\n            }\n        }\n    }\n}\n\n.task-loading {\n    position: fixed;\n    top: 0;\n    display: flex;\n    align-items: center;\n    justify-content: center;\n    width: 100vw;\n    height: 100vh; // 第一套设计方案\n    // background: $blue;\n    // 第二套设计方案\n    background: $light;\n    z-index: -1;\n    opacity: 0;\n    transition: opacity .3s ease-in;\n    &.active {\n        z-index: 9;\n        opacity: 1;\n        transition: opacity .3s ease-in;\n    }\n}\n\n.task-footer {\n    // position: fixed;\n    // bottom: 0;\n    margin-top: 20px;\n    flex: none;\n    width: 100vw;\n    height: 44px;\n    text-align: center;\n    .task-footer-wrap {\n        >a {\n            display: inline-block;\n            color: $blue;\n            text-decoration: none;\n        }\n        margin: 0 auto;\n        width: $width;\n        line-height: 44px;\n        font-size: 12px;\n    }\n}\n\n.task-panel-mask {\n    position: fixed;\n    top: 0;\n    z-index: 5;\n    display: flex;\n    justify-content: center;\n    width: 100vw;\n    height: calc(100vh - 44px);\n    background: $blue;\n    opacity: 0;\n    transform: translate3d(0, -100vh, 0);\n    transition: all 0.3s cubic-bezier(1, 0.01, 1, 1);\n    >div {\n        display: flex;\n        align-self: center;\n        align-items: center;\n        justify-content: center;\n        flex-direction: column;\n    }\n    &.active {\n        opacity: 1;\n        transform: translate3d(0, 0, 0);\n        transition: all 0.3s cubic-bezier(0.06, 0.59, 0.53, 0.71);\n    }\n    .task-panel-close {\n        // display: inline\n        position: absolute;\n        top: 10px;\n        right: 10px;\n        width: 20px;\n        height: 20px;\n        background: red;\n    }\n}\n\n.task-panel {\n    display: flex;\n    flex-direction: column;\n    justify-content: center;\n    align-items: center;\n    margin-top: 150px;\n    width: 500px;\n    height: 40px;\n    border-radius: 5px;\n    background: #FFF; // box-shadow: 0 0 5px 0px rgba(6, 74, 169, 0.5);\n    >label {\n        position: relative;\n        width: 100%;\n        text-align: center;\n    }\n    input {\n        padding: 0 15px;\n        padding-right: 115px;\n        width: 100%;\n        line-height: 40px;\n        font-size: 12px;\n        color: $font-color;\n        text-align: left;\n        background: #FCFEFF;\n        border-radius: 2px;\n        transition: all .3s ease-out;\n        &:focus {\n            transition: all .3s ease-in;\n        }\n        &::-webkit-input-placeholder {\n            color: #C1C1C2;\n        }\n    }\n    .task-fliter-items {\n        position: absolute;\n        width: 100%;\n        margin-top: 10px;\n        border-radius: 2px;\n        background: $light;\n        overflow: hidden; // box-shadow: 0 0 5px 0px rgba(6, 74, 169, 0.5);\n    }\n    .task-fliter-item {\n        position: relative;\n        padding: 10px 15px 12px 65px;\n        text-align: left;\n        cursor: pointer;\n        transition: all .2s ease-out;\n        >span {\n            display: -webkit-box;\n            -webkit-box-orient: vertical;\n            -webkit-line-clamp: 2;\n            overflow: hidden;\n            line-height: 1.5;\n            letter-spacing: .05em;\n        }\n        &:not(:last-child) {\n            border-bottom: 1px solid $border-color;\n        }\n        &:nth-child(n+11) {\n            display: none;\n        }\n        &:hover {\n            background: $border-color;\n            transition: all .2s ease-in;\n        }\n        &:before {\n            content: '开发任务';\n            background: $green;\n            @extend %itemIcon;\n        }\n        &.type-bug {\n            &:before {\n                content: '修复缺陷';\n                background: $bug-color;\n            }\n        }\n    }\n}\n\n.task-next {\n    position: absolute;\n    top: 0;\n    right: 0;\n    width: 100px;\n    height: 40px;\n    text-align: center;\n    color: $light;\n    border-top-right-radius: 2px;\n    border-bottom-right-radius: 2px;\n    font-weight: bold;\n    @extend %green-button;\n    &.task-continue {\n        @extend %red-button;\n        &:after {\n            content: '继续任务';\n        }\n    }\n    &:after {\n        content: '新任务';\n    }\n}\n\n.task-panel-continue {\n    display: flex;\n    align-self: center;\n    align-items: center;\n    justify-content: center;\n    flex-direction: column;\n    width: 500px;\n    height: 300px;\n    background: $light;\n    border-radius: 5px;\n    box-shadow: 0 0 5px 0px rgba(6, 74, 169, 0.5);\n    .task-panel-continue-title {\n        // width: 75%;\n        // padding: 0 50px;\n        // line-height: 40px;\n        // margin-bottom: 20px;\n        // @extend %text-overflow;\n        width: 75%;\n        margin-bottom: 10px; // padding-bottom: 10px;\n        padding: 10px 5px;\n        >span {\n            display: none;\n            font-weight: bold;\n            line-height: 32px;\n            padding-bottom: 5px;\n        }\n    }\n    .ant-steps {\n        cursor: pointer; //     .ant-steps-item {\n        //         &:nth-child(1) {\n        //             .ant-steps-head-inner {\n        //                 border-color: $bug-color;\n        //                 background-color: $bug-color;\n        //             }\n        //         }\n        //     }\n    }\n    .ant-steps-status-process {\n        .ant-steps-title {\n            font-weight: bold!important;\n        }\n    }\n    .ant-steps-title {\n        font-weight: 400!important;\n    }\n    .task-panel-continue-info {\n        display: flex;\n        margin-bottom: 10px;\n        width: 75%;\n        >input {\n            flex: 1;\n            text-align: center;\n            &:nth-child(1) {\n                &~* {\n                    margin-left: 10px;\n                }\n            }\n        }\n        .ant-steps {\n            padding-bottom: 5px;\n        }\n        .ant-switch {\n            flex: none;\n            width: 50%;\n            height: 32px;\n            line-height: 30px;\n            border-color: $green;\n            background-color: $green;\n            &:after {\n                width: 28px;\n                height: 28px;\n            }\n        }\n        .ant-switch-inner {\n            margin-left: 34px;\n        }\n        .ant-switch-checked {\n            border-color: $bug-color;\n            background-color: $bug-color;\n            .ant-switch-inner {\n                margin-left: 10px;\n            }\n            &:after {\n                margin-left: -29px;\n            }\n        }\n    }\n    .task-panel-continue-info-input {\n        display: flex; // padding: 0 15px;\n        flex: 1;\n        line-height: 40px;\n        font-size: 12px;\n        color: $font-color;\n        text-align: center;\n        background: $light;\n        border-radius: 2px;\n        border: 1px solid $border-color;\n        transition: all .3s ease-out;\n        &:nth-child(1) {\n            &~input {\n                margin-left: 10px;\n            }\n        }\n        &:focus {\n            border: 1px solid $blue;\n            transition: all .3s ease-in;\n        }\n        &::-webkit-input-placeholder {\n            color: #C1C1C2;\n        }\n    }\n    .task-panel-continue-info-state {\n        display: flex;\n        flex: 1; // padding: 0 15px;\n        line-height: 40px;\n        font-size: 12px;\n        color: $light;\n        text-align: center;\n        border-radius: 2px;\n        -webkit-appearance: button;\n        cursor: pointer;\n        &:after {\n            content: '进行中';\n            flex: 1;\n            background: $orange;\n            transition: background .3s ease;\n        }\n        &:checked {\n            &:after {\n                content: '已完成';\n                flex: 1;\n                background: $green;\n                transition: background .3s ease;\n            }\n        }\n        &.task-panel-continue-info-type {\n            &:after {\n                content: '开发任务';\n                flex: 1;\n                background: $green;\n            }\n            &:checked {\n                &:after {\n                    content: '修复缺陷';\n                    flex: 1;\n                    background: $bug-color;\n                }\n            }\n        }\n        &.hide {\n            display: none;\n        }\n    }\n    .task-panel-continue-submit {\n        padding-top: 10px;\n        >button {\n            width: 100px;\n            height: 32px;\n            border-radius: 2px;\n            &:nth-child(1) {\n                &~button {\n                    margin-left: 20px;\n                }\n            }\n        }\n    }\n    .task-panel-cancel {\n        background: #eee;\n        &:after {\n            display: inline-block;\n            content: '取消';\n        }\n    }\n    .task-panel-enter {\n        color: #fff;\n        background: $blue;\n        &:after {\n            display: inline-block;\n            content: '确认';\n        }\n    }\n}\n\n.task-filter {\n    position: absolute;\n    left: 0;\n    top: -10px;\n    display: flex;\n    align-items: center;\n    padding: 0 20px;\n    height: 36px;\n    line-height: 3;\n    transform: translate(0, -100%);\n    .task-filter-item {\n        padding: 0 10px;\n        line-height: 2;\n        color: $blue;\n        border-radius: 2px;\n        background: $light-blue;\n    }\n}\n\n.task-statistics {\n    margin-bottom: 40px;\n}\n\n.task-statistics-chart {\n    margin: 40px 0;\n    .recharts-wrapper {\n        display: inline-block;\n    }\n}\n\n.ant-table-body {\n    .ant-table-thead {\n        th {\n            font-weight: 400;\n        }\n    }\n    tr {\n        text-align: center;\n    }\n}","/* 公共变量 */\n\n$light-blue:#CBE5FB;\n$blue:#3fbbf5;\n$green:#1fc759;\n$green-active:#00bb36;\n$line-color:#E6E8EB;\n$font-color:#585858;\n$bug-color:#FF4351;\n$warning:$bug-color;\n$warning-active:#f13d30;\n$orange:#FFC107;\n$border-color:#E6E8EB;\n$light:#FFF;\n$width:1000px;\n$line-height:40px;\n\n%green-button {\n    text-align: center;\n    color: #FFF;\n    background: #afe24d;\n    transition: all .3s ease-in;\n    &:hover {\n        background: #b5e45a;\n        transition: all .3s ease-in;\n    }\n    &:active {\n        background: #a1d243;\n        transition: all .3s ease-in;\n    }\n}\n%red-button {\n    text-align: center;\n    color: #FFF;\n    background: #ff5c69;\n    transition: all .3s ease-in;\n    &:hover {\n        background: #ff1f30;\n        transition: all .3s ease-in;\n    }\n    &:active {\n        background: #f64c59;\n        transition: all .3s ease-in;\n    }\n}\n\n%text-overflow {\n    text-overflow: ellipsis;\n    white-space: nowrap;\n    overflow: hidden;\n}\n"],
